import React from "react";
import Header from "./components/Header";
import Footer from "./components/Footer";
import Notes from "./Notes";
import Note from "./components/Note";

function newNotes(nDetail) {
  return <note nTitle={nDetail.title} nContent={nDetail.content} />;
}

function App() {
  return (
    <div>
      <Header />
      {Notes.map(newNotes)}
      <Footer />
    </div>
  );
}
export default App;
